import './estilo.css'
import perfil from './imagens/perfil.png'
import sacola from '../imagens/sacola.png'
const icones = [ perfil, sacola]


function IconesHeader(){
    return(
        <ul className='icones'>
                {icones.map((icone)=> (
                  <li><img className='icone' src={icone}></img></li>
                ))}
        </ul>
    )
}

export default IconesHeader
